Defendant Donquisa Monique Blackmore in court with attorney Christian Thomas Eichenlaub.  Joy Hammond appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 4 MONTHS in the House of Correction with credit for 3 days time served; huber for work, child care and treatment.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions:
*  Maintain full time employment/school or a combination of both;
*  Establish paternity;
*  Perform 20 hours of community service; perform 5 hours per month for the first 4 months;
*  Submit a DNA sample and pay the DNA surcharge.

Court will waive any costs and surcharges that can be waived due to the defendant's inability to pay.  If the defendant commits no new crimes and successfully completes probation, Court will grant expungement.  Notice of Right to Seek Postconviction Relief received and filed.
